    /**
     * Move footer to bottom
     */
    footerMove: function () {
      var ua = navigator.userAgent.toLowerCase();
      var isOpera = (ua.indexOf('opera') > -1);
      var isIE = (!isOpera && ua.indexOf('msie') > -1);
      var viewportHeight = getViewportHeight();
      var wrapper = $(".wrapper");
      var footer = $(".footer");

      function getViewportHeight() {
        return ((document.compatMode || isIE) && !isOpera)
          ? (document.compatMode == 'CSS1Compat') ? document.documentElement.clientHeight : document.body.clientHeight
          : (document.parentWindow || document.defaultView).innerHeight;
      }

      if (window.location.pathname.search('/app_rambler') == -1) {
        wrapper.css("min-height", viewportHeight - footer.outerHeight(true, true));
      }
    },
    /**
     * Actions for data-types
     */

    typeActionsInit: function (options) {
      var debug = false;
      if (options.debug == true) {
        debug = true;
      }

      $("[data-type]").each(function () {
        var type = $(this).data("type");
        var action = $(this).data("action");

        switch (type) {
          case "changeImage":
            var container = $($(this).data("load-container"));
            var src = $(this).data("src");

            $(this).on(action, function () {
              container.empty();
              var tmpImg = new Image();
              tmpImg.src = src;
              tmpImg.onload = function () {
                container.stop().animate({"height": this.height}, 500, function () {
                  $(tmpImg).css("display", "none");
                  container.append(tmpImg);
                  $(tmpImg).fadeIn("400");
                });
              };
            })
            break;
          case "hiddenInit":
            var container = $($(this).attr("href"));

            $(this).on(action, function () {
              Application.hiddenInitialize(container);
            })
            break;
          case "closeModal":
            var dismiss = $(this).data("dismiss");

            if (dismiss) {
              $(this).on("click", function () {
                $(this).parents("." + dismiss).hide();
              });
            }
            break;
          case "duplicate":
            var target = $($(this).data("target"));
            var targetClone = target.clone();
            var container = $($(this).data("container"));
            var action = $(this).data("action");

            Application.hiddenInitialize(target);
            $(this).on(action, function () {
              var clone = targetClone.clone();

              clone.find(':input')
                .val('')
                .removeAttr('checked')
                .removeAttr('selected');

              container.append(clone);

              Application.hiddenInitialize(clone);
              var target = '.graduate-empty';
              $(target).find('.remove-educ').show();
              $(target).eq($(target).length - 1).find('.remove-educ').hide();

              var target = '.subject-one-empty';
              $(target).find('.remove-subject').show();
              $(target).eq($(target).length - 1).find('.remove-subject').hide();

              $('.scan-input-file').trigger('upload.init');

              return false;
            });
            break;
          case "setActive":

            var target = $(this).data("target");
            var container = $(this).data("container");

            if (target == "this") {
              target = $(this);
            } else {
              target = $(this).find(target);
            }

            if (container == "this") {
              container = $(this);
            } else {
              container = target.parents($(this).data("container"));
            }

            $(target).on(action, function () {

              container.toggleClass("active");
              if (container.hasClass("active")) {
                container.find("input[type='text'], textarea").removeAttr("disabled").trigger('refresh');
              } else {
                container.find("input[type='text'], textarea").attr("disabled", true).trigger('refresh');
              }
            });

            if (!(container.hasClass("active"))) {
              container.find("input[type='text'], textarea").attr("disabled", true).trigger('refresh');
            }

            break;
        }
      });
    },
