    /**
     * Lazy load images on news detail page
     */
    loadDetailBg: function (options) {
      var debug = false;
      if (options.debug == true) {
        debug = true;
      }

      $(".news-detail").each(function () {
        var head = $(this).find(".detail-head");
        var headBody = head.find(".body");
        var bgBlock = headBody.find(".background-image")
        var src = bgBlock.data("js-background");

        if (src != undefined) {
          var tmpImg = new Image();
          tmpImg.src = src;
          tmpImg.onload = function () {

            headBody.animate({"min-height": this.height}, 500, function () {
              bgBlock.css("background-image", 'url(' + tmpImg.src + ')');
              bgBlock.animate({"opacity": 1}, 300);
            });
          };
        }

      });
    }
