      init: function () {
        this.socInputsConts = $(".social-input");

        if (!(this.socInputsConts.length)) {
          return false;
        }
        this.socInputsConts.each(function () {
          var socInput = $(this).find("input[type='text']");
          var clearButton = $(this).find(".input-clear");
          if (socInput.val()) {
            clearButton.show();
          }
          clearButton.on("click", function () {
            socInput.val("");
            $(this).hide();
          });
          socInput.on("keyup", function () {
            if ($(this).val()) {
              clearButton.show();
            } else {
              clearButton.hide();
            }
          })
        })
      }
