/**
 * Fly item to cart
 * @namespace Directives
 */
(function() {
  'use strict';

  angular
    .module('app')
    .directive('flyToCart', flyToCart);

  flyToCart.$inject = ['$interval'];
  function flyToCart($interval) {
    return function(scope, element, attrs) {
      scope.runFlyAnimation = function(flyId) {
        var fly = $('[fly-to-cart='+ flyId +']:visible').eq(0)
          , flyContainer = fly.parents(attrs.flyContainer).eq(0)
          , flyTarget = flyContainer.find(attrs.flyTarget)
          , flyTargetGoal = $(attrs.flyTargetGoal)
          , flySpeed = attrs.flySpeed || 500;

        var intervalPromise = $interval(function() {
          if (flyTargetGoal.is(':visible')) {
            doAnimate();
            $interval.cancel(intervalPromise);
          }
        }, 100);

        function doAnimate() {
          if (!flyTarget) return;
          setTimeout(function() {
            var imgClone = flyTarget.clone()
              .offset({
                top: flyTarget.offset().top,
                left: flyTarget.offset().left
              })
              .css({
                'opacity': '0.5',
                'position': 'absolute',
                'height': '150px',
                'width': '150px',
                'z-index': '121'
              })
              .appendTo($('body'))
              .animate({
                'top': flyTargetGoal.offset().top + 10,
                'left': flyTargetGoal.offset().left + 10,
                'width': 75,
                'height': 75
              }, flySpeed, 'easeInOutExpo');

            imgClone.animate({
              'width': 0,
              'height': 0
            }, function () {
              $(this).detach();
            });
          }, 100);
        }
      }
    }
  }
})();


