(function() {
  'use strict';

  angular
    .module('app')
    .controller('CartController', CartController);

  CartController.$inject = ['$dnevnik', 'cartItemService', '$log', '$rootScope', '$timeout'];

  function CartController($dnevnik, cartItemService, $log, $rootScope, $timeout) {
    var vm = this;
    vm.firstLoad = true;
    vm.items = [];
    vm.holding = {};
    vm.itemsPrevCount = 0;
    vm.itemsLimit = 4;
    vm.itemsLimitFilter = vm.itemsLimit;
    vm.showItemFlag = false;
    vm.remove = removeItem;
    vm.clear = clearItems;
    vm.showMore = showMore;
    vm.showItem = showItem;
    vm.dnevnik = $dnevnik;
    vm.isRambler = false;
    vm.prefix = '';

    if (window.appPrefix && appPrefix.length > 0) {
      vm.prefix = appPrefix;
    } else if (window.location.pathname.search('/app_dnevnik') != -1) {
      vm.prefix = '/app_dnevnik';
    } else if (window.location.pathname.search('/app_rambler') != -1) {
      vm.prefix = '/app_rambler';
      vm.isRambler = true;
    } else if (window.location.pathname.search('/app_mosreg') != -1) {
      vm.prefix = '/app_mosreg';
      vm.isRambler = true;
    } else if (window.location.pathname.search('/app_pumbr') != -1) {
      vm.prefix = '/app_pumbr';
    } else if (window.location.pathname.search('/m/') != -1) {
        vm.prefix = '/m';
    }

  // Init cart items
    initCartItems();

    $rootScope.$on('cart:rebuild', function() {
      initCartItems();
    });

    function showItem(flagForce) {
      vm.showItemFlag = flagForce || !vm.showItemFlag;
      if (vm.showItemFlag) {
        $('.item-list-scroll').niceScroll('.item-list-scroll ul', {
          cursorcolor: "#ff7e04",
          cursoropacitymin: 0,
          cursorwidth: 10,
          bouncescroll: false,
          horizrailenabled: false,
          railpadding: {
            top: 0,
            right: 1,
            bottom: 0,
            left: 1
          }
        });
      }
    }

    function showMore(currLimit) {
      vm.itemsLimitFilter = (currLimit == vm.itemsLimit) ? vm.items.length : vm.itemsLimit;
    }

    function clearItems() {
      return cartItemService.clearItems()
        .then(function(data) {
          $rootScope.$emit('cart:updateItems', data.items);
          vm.items = data.items;
          vm.holding = data.holding;
        });
    }

    function removeItem(id) {
      return cartItemService.removeItem(id)
        .then(function() {
          initCartItems();
        });
    }

    function initCartItems() {
      return getCartItems().then(function(){
        vm.firstLoad = false;
        $log.debug('Cart items successful view');
      });
    }

    function getCartItems() {
      vm.itemsPrevCount = vm.items.length;
      return cartItemService.getItems()
        .then(function(data) {
          $rootScope.$emit('cart:updateItems', data.items);
          vm.items = data.items;
          vm.holding = data.holding;
          vm.itemsLimitFilter = (vm.itemsLimitFilter != vm.itemsLimit && !vm.firstLoad)
            ? vm.items.length
            : vm.itemsLimit;

          if (vm.isRambler && vm.itemsPrevCount < vm.items.length) showItem(true);
          return vm.items;
        });
    }
  }
})();

