(function() {
  'use strict';

  angular
    .module('app')
    .controller('LocationController', LocationController);

  LocationController.$inject = ['locationItemService', '$log', '$rootScope'];

  function LocationController(locationItemService, $log, $rootScope) {

    var vm = this;

    vm.options = {
      city : "",
      filterGetValues: false,
      filterName : "arrFilter",
      metroPropertyId: "",
      districtsPropertyId: ""
    };

    vm.filters = {
      metroFilter: [],
      districtsFilter: []
    };

    vm.lines = [];
    vm.stations = [];
    vm.districts = [];

    vm.metroSelected = [];
    vm.districtsSelected = [];

    vm.isChecked = isChecked;
    vm.init = initLocationInfo;

    vm.isEmptyContainer = isEmptyContainer;
    vm.setModalSelection = setModalSelection;

    vm.reloadCity = reloadCity;

    $rootScope.$on("location:rebuild", rebuildSelects);
    $rootScope.$on("location:setReturnedData", setReturnedData);

    function setModalSelection() {
      $rootScope.$emit("map:setSelectionData", {
        metroSelected : vm.metroSelected,
        districtsSelected: vm.districtsSelected
      });
    }

    function setReturnedData(event, selected) {
      vm.metroSelected = selected.metroSelected;
      vm.districtsSelected = selected.districtsSelected;
    }

    function rebuildSelects(event, city) {
      vm.options.city = city;
      initLocationInfo();
    }

    function resetVals() {
      vm.lines = null;
      vm.stations = null;
      vm.districts = null;
    }
    function isChecked(haystack, id) {

      if(haystack != null) {
        if(typeof(haystack) == "string") {
          if (parseInt(haystack) == id) {
            return true
          }
        } else {
          for (var i = 0, length = haystack.length; i < length; i++) {
            if (parseInt(haystack[i]) == id) {
              return true
            }
          }
        }

        return false;
      }
    }

    function isEmptyContainer() {
      return !(vm.districts != null || vm.stations != null);
    }

    function initLocationInfo() {
      if(vm.options.city != null) {
        return locationItemService.getCityInfo(vm.options, vm.filters)
          .then(function(data) {
            vm.lines = data.LINES;
            vm.districts = data.DISTRICTS;
            vm.stations = data.STATIONS;

            $rootScope.$emit(
              "map:init",
              vm.options,
              vm.filters,
              {
                lines: vm.lines,
                districts: vm.districts,
                stations: vm.stations
              }
            );
          });
      } else {
        resetVals();
      }
    }
    function reloadCity(cityId) {
      $rootScope.$emit(
        "location:rebuild",
        cityId
      );
    }
  }
})();

