(function() {
  'use strict';

  angular
    .module('app')
    .controller('MapController', MapController);

  MapController.$inject = ['locationItemService', '$log', '$rootScope', '$scope'];

  function MapController(locationItemService, $log, $rootScope, $scope) {

    var vm = this;

    vm.options = {
      city : "",
      geoStr: ""
    };

    vm.filters = {
      metroFilter: [],
      districtsFilter: []
    };

    vm.map = {};

    vm.lines = [];
    vm.stations = [];
    vm.districts = [];

    vm.metroSelected = [];
    vm.districtsSelected = [];

    vm.closestMetro = '';
    vm.closestDistrict = '';

    vm.closestMetroButton = '';

    vm.initMap = initMap;
    vm.returnData = returnData;
    vm.setSelectionData = setSelectionData;

    vm.changeLocation = changeLocation;
    vm.initLocation = initLocation;
    vm.setPlacemark = setPlacemark;

    vm.changeClosestInfo = changeClosestInfo;
    vm.getClosestInfo = getClosestInfo;
    vm.chooseOption = chooseOption;
    vm.getButtonClass = getButtonClass;

    $rootScope.$on("map:init", initMap);
    $rootScope.$on("map:setSelectionData", setSelectionData);


    function chooseOption(event, id, select) {

      if(vm[select] == null) {
        vm[select] = [parseInt(id)];
      } else {
        if(!inArray(vm[select], parseInt(id)))
        vm[select].push(parseInt(id));
      }

      event.preventDefault();
    }

    function isChecked(haystack, id) {
      if(haystack != null) {
        for (var i = 0, length = haystack.length; i < length; i++) {
          if (parseInt(haystack[i].ID) == parseInt(id)) {
            return true
          }
        }
        return false;
      }
    }

    function inArray(haystack, id) {
      return $.inArray(parseInt(id), haystack) > -1;
    }

    function initMap(event, options, filters, data) {
      vm.filters = filters;
      vm.options = options;

      vm.lines = data.lines;
      vm.stations = data.stations;
      vm.districts = data.districts;
    }

    function setSelectionData(event, data) {
      vm.metroSelected = data.metroSelected;
      vm.districtsSelected = data.districtsSelected;
    }

    function returnData(controller) {
      $rootScope.$emit(
        controller+":setReturnedData",
        {
          metroSelected: vm.metroSelected,
          districtsSelected: vm.districtsSelected
        }
      );
    }

    function changeLocation(event) {
      vm.setPlacemark(event.get('coords'));
    }

    function getButtonClass(id, selected, haystack) {
      if(id == null || !isChecked(haystack, id)) {
        return 0;
      }

      if(inArray(selected, id)) {
        return 1;
      }
    }

    function initLocation(target) {

      var geolocation = ymaps.geolocation;
      vm.map = target;

      geolocation.get({
        provider: 'browser',
        mapStateAutoApply: true
      }).then(function (result) {
        vm.map.setCenter(result.geoObjects.position, 10);
        vm.setPlacemark(result.geoObjects.position);
      });

      var searchControl = new ymaps.control.SearchControl({
        options: {
          noPlacemark: true
        }
      });
      searchControl.events.add('resultshow', function (e) {
        var results = searchControl.getResultsArray(),
          selected = e.get('index'),
          point = results[selected].geometry.getCoordinates();
          vm.setPlacemark(point);
      }, this);


      vm.map.controls.add(searchControl);

    };


    function setPlacemark(coords) {

      if(vm.curPlacemark != null) {
        vm.map.geoObjects.remove(vm.curPlacemark);
      }
      var myGeoObject = new ymaps.GeoObject({
          geometry:{
            type:'Point',
            coordinates:coords
          },
          properties: {
            iconContent: '',
            hintContent: ''
          }
        },{ draggable: true }
      );

      vm.curPlacemark = myGeoObject;
      vm.map.geoObjects.add(myGeoObject);

      vm.changeClosestInfo(coords);
    }

    function getClosestInfo(options) {
      if(options.city != null) {
        return locationItemService.getClosestInfo(vm.options.city, options)
          .then(function(data) {
            if(data.DISTRICT != null) {
              vm.closestDistrict = data.DISTRICT;
            }
            if(data.STATION != null) {
              vm.closestMetro = data.STATION;
            }
          });
      }
    }

    function changeClosestInfo(coords) {

      var options = {};

      ymaps.geocode(
        coords, { kind: "locality" }
      ).then(function (res) {
        if(res.geoObjects.get(0)) {
          options.city = res.geoObjects.get(0).properties.get('metaDataProperty.GeocoderMetaData.AddressDetails.Country.AdministrativeArea.SubAdministrativeArea.Locality.LocalityName');

          ymaps.geocode(
            coords, { kind: "metro"}
          ).then(function (res) {
            if(res.geoObjects.get(0)) {
              options.station = $.trim(res.geoObjects.get(0).properties.get('name').replace(" ", ""));
            }

            ymaps.geocode(
              coords, { kind: "district"}
            ).then(function (res) {
              if(res.geoObjects.get(0)) {
                options.district = res.geoObjects.get(0).properties.get('metaDataProperty.GeocoderMetaData.AddressDetails.Country.AdministrativeArea.SubAdministrativeArea.Locality.DependentLocality.DependentLocalityName');
              }

              vm.getClosestInfo(options);

            });
          });
        }
      });
    }
    
    
  }
})();



