(function() {
  'use strict';

  angular
    .module('app')
    .controller('RepetitorRating', RepetitorRating);

  RepetitorRating.$inject = ['$scope', 'ratingService', '$log', '$compile'];

  function RepetitorRating($scope, ratingService, $log,  $compile) {
    $scope.data = {};
    $scope.items = [];
    $scope.filter = {};
    $scope.pagination = pagination;
    $scope.filterProcess = filterProcess;

    initDataRating();

    /**
     * @name pagination
     * @desc Apply filter
     * @returns {*}
     */
    function filterProcess() {
      getDataRating($scope.filter);
    }

    /**
     * @name pagination
     * @desc Pagination handler
     * @returns {*}
     */
    function pagination(pagenType, pagen) {
      var filterCopy = $scope.filter;
      filterCopy[pagenType] = pagen;
      getDataRating(filterCopy);
    }


    /**
     * @name initDataRating
     * @desc Init data rating
     * @returns {*}
     */
    function initDataRating() {
      getDataRating({}).then(function(){
        $log.debug('Rating data successful view');
      });
    }

    /**
     * @name getDataRating
     * @desc Get data rating
     * @returns {*}
     */
    function getDataRating(options) {
      return ratingService.getData(options)
        .then(function(response) {
          $scope.data = response['DATA'];
          $scope.items = response['ITEMS'];
          jQuery('#rating-pagination').html($compile(response['NAV_STRING'])($scope));
        });
    }
  }
})();

