/**
 * Sale Controller
 * @namespace Controller
 */
(function () {
  'use strict';

  angular
    .module('app')
    .controller('SaleController', SaleController);

  SaleController.$inject = ['$dnevnik', '$http', '$location', '$scope', '$rootScope', '$window', 'cartItemService', 'locationItemService'];

  function SaleController($dnevnik, $http, $location, $scope, $rootScope, $window, cartItemService, locationItemService) {
    var vm = this;
    vm.typeAuth = 'register';
    vm.errors = {};
    vm.repetitorSubject = [];
    vm.mapType = '';

    // Location self
    vm.metroSelf = [];
    vm.districtSelf = [];

    // Location student
    vm.metroStudent = [];
    vm.districtStudent = [];

    vm.subject = [];
    vm.isProcessForm = false;
    vm.changeTypeAuth = changeTypeAuth;
    vm.processForm = processForm;
    vm.checkErrors = checkErrors;
    vm.isSupportSubject = isSupportSubject;
    vm.initLocationInfo = initLocationInfo;
    vm.openMapModal = openMapModal;
    vm.options = {
      city: "",
      filterGetValues: false,
      filterName: "arrFilter",
      metroPropertyId: "",
      districtsPropertyId: ""
    };

    vm.filters = {
      metroFilter: [],
      districtsFilter: []
    };

    vm.prefix = '';
    if (window.appPrefix && appPrefix.length > 0) {
      vm.prefix = appPrefix;
    } else if (window.location.pathname.search('/app_dnevnik') != -1) {
      vm.prefix = '/app_dnevnik';
    } else if (window.location.pathname.search('/app_rambler') != -1) {
      vm.prefix = '/app_rambler';
    } else if (window.location.pathname.search('/app_mosreg') != -1) {
      vm.prefix = '/app_mosreg';
    } else if (window.location.pathname.search('/app_pumbr') != -1) {
      vm.prefix = '/app_pumbr';
    } else if (window.location.pathname.search('/m/') != -1) {
      vm.prefix = '/m';
    }

    $rootScope.$on('cart:updateItems', updateCartItems);
    $rootScope.$on("location:setReturnedData", filterMapData);

    function filterMapData(event, selected) {
      if (vm.mapType == 'self') {
        vm.metroSelf = selected.metroSelected;
        vm.districtSelf = selected.districtsSelected;
      } else if (vm.mapType == 'student') {
        vm.metroStudent = selected.metroSelected;
        vm.districtStudent = selected.districtsSelected;
      }
    }

    function initLocationInfo() {
      return locationItemService.getCityInfo(vm.options, vm.filters)
        .then(function (data) {
          $rootScope.$emit(
            "map:init",
            vm.options,
            vm.filters,
            {
              lines: data.LINES,
              districts: data.DISTRICTS,
              stations: data.STATIONS
            }
          );
        });
    }

    /**
     * @return {*}
     */
    function openMapModal(type) {
      vm.mapType = type;
      if (vm.mapType == 'self') {
        $rootScope.$emit("map:setSelectionData", {
          metroSelected: vm.metroSelf,
          districtsSelected: vm.districtSelf
        });
      } else if (vm.mapType == 'student') {
        $rootScope.$emit("map:setSelectionData", {
          metroSelected: vm.metroStudent,
          districtsSelected: vm.districtStudent
        });
      }

      $('#setFilterModal').modal('show');

    }

    /**
     * @returns {Boolean}
     */
    function isSupportSubject(item) {
      if (!vm.repetitorSubject[item]) return false;
      for (var i = 0, length = vm.repetitorSubject[item].length; i < length; i++) {
        if (vm.repetitorSubject[item][i] == vm.subject) return true;
        for (var j = 0, subjectLength = vm.repetitorSubject[item].length; j < subjectLength; j++) {
          if ($.inArray(vm.repetitorSubject[item][i], vm.subject) != -1) return true;
        }
      }

      return false;
    }

    /**
     * @name updateProductItems
     * @desc Update cart items
     * @returns {*}
     */
    function updateCartItems(event, items) {
      if (!items.length) $window.location.href = vm.prefix ? vm.prefix + '/order/' : '/order/';
    }

    /**
     * @name checkErrors
     * @desc Check count errors
     * @returns {Number}
     */
    function checkErrors(errors) {
      return Object.keys(errors).length;
    }

    /**
     * @name changeTypeAuth
     * @desc Switcher type auth
     * @returns {*}
     */
    function changeTypeAuth(type) {
      vm.typeAuth = (type == 'register' || type == 'login') ? type : vm.typeAuth;
    }

    /**
     * @name processForm
     * @desc Handler form
     * @returns {*}
     */
    function processForm(event) {
      vm.errors = {};
      vm.isProcessForm = true;

      var formData = $(event.target).serialize()
        , request = $http({
          method: 'post',
          url: $location.path(),
          data: formData
        });

      request.success(handlerResponse);
      function handlerResponse(data) {
        if (data.success) {
          Analytics.mediatron7SubmitOrder();

          if (typeof yaCounter32946594 != 'undefined') {
            yaCounter32946594.reachGoal('CART_SALE_2');
          }
          if (typeof ga != 'undefined') {
            ga('send', 'event', 'request', 'teacher');
          }
          cartItemService.clearItems();

          var defaultUri = '/personal/entries/';
          if (data['redirectUri']) {
            defaultUri = data['redirectUri'];
          }

          $window.location.href = vm.prefix ? vm.prefix + defaultUri + '&finish=Y' : defaultUri;
        } else {
          vm.isProcessForm = false;
          vm.errors = data.errors;
        }
      }

      event.preventDefault();
    }
  }
})();

